import Firebase from "firebase/app";
import "firebase/firestore";
import "firebase/auth";

const config = {
  apiKey: process.env.REACT_APP_FIREBASE_API_KEY,
  authDomain: process.env.REACT_APP_FIREBASE__AUTH_DOMAIN,

  projectId: process.env.REACT_APP_FIREBASE_PROJECT_ID,
  storageBucket: process.env.REACT_APP_FIREBASE_STORAGE_BUCKET,
  messagingSenderId: process.env.REACT_APP_FIREBASE_MESSAGING_SENDERID,
  appId: process.env.REACT_APP_FIREBASE_APPID,
  // apiKey: "AIzaSyAxVhRE2f-0QsHpWeVFt9RuTeEe3kcs8DM",
  // authDomain: "netflix-clone-e41c2.firebaseapp.com",
  // projectId: "netflix-clone-e41c2",
  // storageBucket: "netflix-clone-e41c2.appspot.com",
  // messagingSenderId: "431300255845",
  // appId: "1:431300255845:web:f60c3dc48d6d1b8907268c",
};

const firebase = Firebase.initializeApp(config);
const auth = firebase.auth();

export { firebase, auth };
